	add("octavation", "{\"term\":\"octavation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"First attested in 1922; probably formed as {{suffix|octave|alt1\u003doctav(e)|ation|lang\u003den}}, but compare \u0027octavate\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027, Frank Ebenezer Miller, \u0027Vocal Art-Science and Its Application\u0027 (2nd edition), pages \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?ei\u003dmc03TqTyNZKr8APV3rjfAg\u0026amp;ct\u003dresult\u0026amp;id\u003dwf85AAAAIAAJ\u0026amp;dq\u003d%2Boctavation\u0026amp;q\u003d%22fourfold+octavation%22 230] and [http://books.google.co.uk/books?ei\u003dmc03TqTyNZKr8APV3rjfAg\u0026amp;ct\u003dresult\u0026amp;id\u003dwf85AAAAIAAJ\u0026amp;dq\u003d%2Boctavation\u0026amp;q\u003d%22octavation+of+voice+and+pitch%22 240]\u0026lt;/span\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It may be said that the sex question is both brain stem and pelvic stem in its fourfold \u0027\u0027octavation\u0027\u0027 with its stabilizing governor, the pituitary body\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"These consist in coördination and correlation, the sex relation of \u0027\u0027octavation\u0027\u0027 of voice and pitch\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, George R Neaderhiser, \u0027Guidelines for the Development of a Comprehensive Music Curriculum for Elementary Secondary Schools\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dAI0JAQAAMAAJ\u0026amp;q\u003d%2Boctavation\u0026amp;dq\u003d%2Boctavation\u0026amp;hl\u003den\u0026amp;ei\u003dF9c3Tv-4GMGq8QPigpHyAg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d7\u0026amp;ved\u003d0CEYQ6AEwBg page unknown]\u0026lt;/span\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"OCTAVATION\u0027\u0027 (also called Pitch Control) — Changing the rate of tape speed over the playback head of a tape recorder changes the pitch of the signal being played back. If the speed is doubled, the signal will increase in pitch one octave\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, Curt Sachs (author) and Jaap Kunst (editor), \u0027The Wellsprings of Music\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dsiUJAQAAMAAJ\u0026amp;q\u003d%2Boctavation\u0026amp;dq\u003d%2Boctavation\u0026amp;hl\u003den\u0026amp;ei\u003dF9c3Tv-4GMGq8QPigpHyAg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d4\u0026amp;ved\u003d0CDkQ6AEwAw page 158]\u0026lt;/span\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A French \u0027rondeau\u0027 from the \u0027Roman de la Rose\u0027 (12th century) first establishes the triad, then turns to the seventh, but leaves it immediately to catch the octave, only to return in haste to the safer, wonted seventh. A similar example of uncertain \u0027\u0027octavation\u0027\u0027 will be described in the following section on the Fate of Quartal and Quintal Patterns\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, William Primrose quoted by David J. Dalton in \u0027Playing the Viola\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003do4oJAQAAMAAJ\u0026amp;q\u003d%2Boctavations\u0026amp;dq\u003d%2Boctavations\u0026amp;hl\u003den\u0026amp;ei\u003dK8s3Tv2hFMOj8QPS8YSZAw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d1\u0026amp;ved\u003d0CCoQ6AEwAA page 202]\u0026lt;/span\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"I arranged ‘\u0027\u0027octavations\u0027\u0027’ which seemed to me to give the two movements greater elegance and litheness\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027 August 19th–24th, Lydia Ayers and Andrew Horner [eds.], \u0027Proceedings of the 1996 International Computer Music Conference\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dXiQKAQAAMAAJ\u0026amp;q\u003d%2Boctavation\u0026amp;dq\u003d%2Boctavation\u0026amp;hl\u003den\u0026amp;ei\u003dMNs3TuqJA8qb8QOi99WYAw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d4\u0026amp;ved\u003d0CDoQ6AEwAw page 127]\u0026lt;/span\u0026gt\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The method provides a simple control mechanism to provide spectral morphing via the \u0027\u0027octavation\u0027\u0027 parameter\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Hayes Biggs and Susan Orzel (editors), \u0027Musically Incorrect\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003deQYZAQAAIAAJ\u0026amp;q\u003d%2Boctavation\u0026amp;dq\u003d%2Boctavation\u0026amp;hl\u003den\u0026amp;ei\u003dMNs3TuqJA8qb8QOi99WYAw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d3\u0026amp;ved\u003d0CDUQ6AEwAg page 13]\u0026lt;/span\u0026gt\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"He also once mentioned a principle of “\u0027\u0027octavation\u0027\u0027” (his term), whereby, coming to a difficult point in the evolution of a contrapuntal texture, the composer could, as it were, escape to fresh territory by the straightforward strategy of jumping a part up or down by an octave\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1923\u0027\u0027, \u0027Medical Review of Reviews\u0027 XXIX, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dgi6gAAAAMAAJ\u0026amp;q\u003d%2Boctavations\u0026amp;dq\u003d%2Boctavations\u0026amp;hl\u003den\u0026amp;ei\u003dK8s3Tv2hFMOj8QPS8YSZAw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d3\u0026amp;ved\u003d0CDIQ6AEwAg page 22]\u0026lt;/span\u0026gt\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Energy is apparently transmuted by a series of \u0027\u0027\u0027octavations\u0027\u0027\u0027 and that these \u0027\u0027octavations\u0027\u0027 \u0027differentiate\u0027 matter\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1947\u0027\u0027, George Llewellyn, \u0027Improved Perpetual Planetary Hour Book\u0027 (rev. ed.), \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dnD92CD3maSYC\u0026amp;pg\u003dPA170\u0026amp;dq\u003d%22this+octavation%22\u0026amp;hl\u003den\u0026amp;ei\u003dhN43Tr_0Gcvn-gb064C0Ag\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d1\u0026amp;ved\u003d0CCoQ6AEwA\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22this%20octavation%22\u0026amp;f\u003dfalse page 170]\u0026lt;/span\u0026gt\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"This \u0027\u0027octavation\u0027\u0027 will be qualified (and perhaps rendered nil) if on a day when Uranus is well aspected its octave Mercury should be adversely aspected, or vice versa\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"of the of a ) from to\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"1949\u0027\u0027, \u0027The American Mathematical Monthly\u0027 LVI, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dZaM0AAAAIAAJ\u0026amp;q\u003d%2Boctavation\u0026amp;dq\u003d%2Boctavation\u0026amp;hl\u003den\u0026amp;ei\u003dA9E3Tt_kJtKu8QPtuNCQAw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d1\u0026amp;ved\u003d0CC0Q6AEwAA page 463]\u0026lt;/span\u0026gt\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"The inverse operation, which is termed “decimation,” together with an adequate treatment for the \u0027\u0027octavation\u0027\u0027 of decimal fractions will be mentioned here without consideration of the details\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"1956\u0027\u0027, Hugh Jones (author) and Richard Lee Morton (editor), \u0027The Present State of Virginia\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003d0oZ5AAAAMAAJ\u0026amp;q\u003d%2Boctavation\u0026amp;dq\u003d%2Boctavation\u0026amp;hl\u003den\u0026amp;ei\u003dA9E3Tt_kJtKu8QPtuNCQAw\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d2\u0026amp;ved\u003d0CDAQ6AEwAQ page 37]\u0026lt;/span\u0026gt\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"The author supplied elaborate rules for the use of the octave system and for the reducing of numbers from the decade to the octave system, and the reverse — processes which he called \u0027\u0027octavation\u0027\u0027 and decimation, respectively\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, Donald E. Knuth, \u0027The Art of Computer Programming\u0027 (2nd edition) II: “Seminumerical Algorithms”, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dvoVQAAAAMAAJ\u0026amp;q\u003d%2Boctavation\u0026amp;dq\u003d%2Boctavation\u0026amp;hl\u003den\u0026amp;ei\u003dF9c3Tv-4GMGq8QPigpHyAg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d3\u0026amp;ved\u003d0CDUQ6AEwAg page 309]\u0026lt;/span\u0026gt\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"The 18th century American mathematician Hugh Jones used the words “\u0027\u0027octavation\u0027\u0027” and “decimation” to describe octal/decimal conversions\", \"priority\":25}]}, \"synonyms\":{}}");

	add("octave", "{\"term\":\"octave\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027lang\u003dla|octavus\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An interval of twelve semitones spanning eight degrees of the diatonic scale, representing a doubling or halving in pitch\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The melody jumps up an \u0027\u0027octave\u0027\u0027 at the beginning, then later drops back down an \u0027\u0027octave\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The singer was known for astounding clarity over her entire five-\u0027\u0027octave\u0027\u0027 range\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027octave\u0027\u0027 has a pitch ratio of 2:1\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The pitch an octave higher than a given pitch\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The bass starts on a low E, and the tenor comes in on the \u0027\u0027octave\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A poetic stanza consisting of eight lines; usually used as one part of a sonnet\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Sir Philip Sidne\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"With mournful melody it continued this \u0027\u0027octave\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The eighth defensive position, with the sword hand held at waist height, and the tip of the sword out straight at knee level\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The day that is one week after a feast day in the Latin Rite of the Catholic Church\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"An eight day period beginning on a feast day in the Latin Rite of the Catholic Church\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A small cask of wine, one eighth of a pipe\", \"priority\":13}]}, \"synonyms\":{}}");

