	add("octothorpe", "{\"term\":\"octothorpe\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Origin disputed. Reportedly a jocular coinage by Bell Labs supervisor Don MacPherson in the early 1960s, from \u0027octo-\u0027 (eight) with reference to its eight points, + \u0027\u0027 (-thorpe) (after 1912 Olympic medalist w:Jim Thorpe|Jim Thorpe, in whom MacPherson was interested). However, Doug Kerr [http://dougkerr.net/pumpkin/articles/Octatherp.pdf] attributes \u0027octatherp\u0027 to a practical joke by engineers John C. Schaak, Herbert T. Uthlaut, and Lauren Asplund upon himself and Howard Eby.\u0027The Merriam-Webster New Book of Word Histories\u0027 (1991) supports \u0027octotherp\u0027 as the original spelling, and telephone engineers as the source.The highly regarded Canadian poet, book designer and typographer, Robert Bringhurst, subscribes to an older, alternate origin of the term:\u0026quot;In cartography, [the octothorp] is a traditional symbol for \u0027village\u0027: eight fields around a central square. That is the source of its name. \u0027Octothorp\u0027 means eight fields.\u0026quot; (From \u0027octo-\u0027 (eight) and \u0027thorpe\u0027 (field, hamlet or small village) )\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The hash or square symbol (), used mainly in telephony and computin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, Willard R. Espy, \u0027A Children\u0027s Almanac of Words at Play\u0027, Clarkson N. Potter, Inc., page 23\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Octothorp\u0027\u0027 is the\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"on a push-button telephone. Rumor at the telephone company is that a man named Charles B. Octothorp, wanting to make his name famous\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Andrew Pitonyak, \u0027Openoffice.Org Macros Explained\u0027, Hentzenwerke, page 13\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Strings are enclosed in double quotation marks, numbers are not enclosed in anything, and dates and Boolean values are enclosed between \u0027\u0027octothorpe\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"characters\", \"priority\":7}]}, \"synonyms\":{}}");

